import React from 'react';
import ContentLoader from 'react-content-loader';

const MyLoader = (props) => (
  <ContentLoader
    speed={2}
    width={476}
    height={124}
    viewBox="0 0 476 124"
    backgroundColor="#f3f3f3"
    foregroundColor="#ecebeb"
    {...props}
  >
    <rect x="65" y="4" rx="3" ry="3" width="216" height="15" />
    <rect x="64" y="31" rx="3" ry="3" width="220" height="14" />
    <circle cx="25" cy="25" r="25" />
    <rect x="554" y="176" rx="0" ry="0" width="35" height="33" />
  </ContentLoader>
);

export default MyLoader;
